import React, { useState, useEffect } from 'react';
import CircularProgress from '@mui/material/CircularProgress';
import Box from '@mui/material/Box';
import axios from 'axios';


const Profile = () => {
    const [loading, setLoading] = useState(true);

    const getToken = localStorage.getItem('userToken');
    
    const TICKET_URL = `http://localhost:8000/api/ticket-list/${getToken}`;
    
    const [tickets, setTickets] = useState({});


    useEffect(() => {
        const getTickets = async () => {
            if(getToken)
            {
                const {data: res} = await axios.get(TICKET_URL)
                setTickets(res);
                setLoading(true);
            }
        }
        getTickets();
        setLoading(false);
    }, [])

    
 
    return(
        <>
            {!loading && 
                <Box sx={{ display: 'flex' }}>
                    <CircularProgress />
                </Box>
            }
            {loading && 
                <div className='container d-flex profile justify-content-center'>
                    {tickets.tickets?.map((ticket) => (

                                <div className="card card-ticket text-center">
                                    <div className="card-header">
                                        Loterijos bilietas #{ticket.ticketNumber}
                                    </div>
                                    <div className='card-body'>
                                        <p>{ticket.name}</p>
                                        <p>{ticket.lastname}</p>
                                    </div>
                                </div>
                    ))}
                    {tickets.tickets?.length === 0 && (
                            <div className="card card-ticket text-center">
                                <div className="card-header">
                                    Informacija
                                </div>
                                <div className='card-body'>
                                    <p>Šiuo metu neturite įsigyje loterijos bilieto</p>
                                </div>
                            </div>
                    )}
                </div>
            }
            {/* <Button loading loadingPosition="start" variant="outlined">
  Fetch data
</Button> */}
        </>
    )
}

export default Profile;
